import "../Components/Homepage.css"

const Homepage = () => {
  return (
    <div className='bg-image-homepage'> Trade Penguin Homepage

    <p><a href='/signin'>Sign In</a></p>
    <p><a href='/register'>Register</a></p>

    </div>
  )
}

export default Homepage
